import styled from 'styled-components';

const SettingsSpaceShipContainer = styled.div`
  width: 90%;
  margin: 8px auto 0;

  border: 2px solid #ffffff;
  border-radius: 10px;
`;

const SettingsSpaceShip = () => {
  return (
    <>
      <p
        style={{
          fontSize: 18,
          fontWeight: 700,
          color: '#FFC700',
          textAlign: 'center',
          letterSpacing: 1,
        }}
      >
        Your spaceship:
      </p>
      <SettingsSpaceShipContainer>

        <p></p>

      </SettingsSpaceShipContainer>
    </>
  );
};

export default SettingsSpaceShip;
